import{_ as e,o as a,c as o,O as r}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 3.2-1010 Enforcement of chapter; summons.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/3.2-1010.md","filePath":"vacode/3.2-1010.md"}'),t={name:"vacode/3.2-1010.md"},n=r('<h1 id="§-3-2-1010-enforcement-of-chapter-summons" tabindex="-1">§ 3.2-1010 Enforcement of chapter; summons. <a class="header-anchor" href="#§-3-2-1010-enforcement-of-chapter-summons" aria-label="Permalink to &quot;§ 3.2-1010 Enforcement of chapter; summons.&quot;">​</a></h1><p>Any conservation police officer or law-enforcement officer as defined in § <a href="/vacode/9.1-101/">9.1-101</a>, excluding certain members of the Virginia Alcoholic Beverage Control Authority, may enforce the provisions of this chapter and the regulations adopted hereunder as well as those who are so designated by the Commissioner. Those designated by the Commissioner may issue a summons to any person who violates any provision of this chapter to appear at a time and place to be specified in such summons.</p><p>1979, c. 372, § 3.1-1029; 2007, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?071+ful+CHAP0087" target="_blank" rel="noreferrer">87</a>; 2008, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0860" target="_blank" rel="noreferrer">860</a>; 2015, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?151+ful+CHAP0038" target="_blank" rel="noreferrer">38</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?151+ful+CHAP0730" target="_blank" rel="noreferrer">730</a>.</p>',3),i=[n];function s(c,l,f,h,m,p){return a(),o("div",null,i)}const g=e(t,[["render",s]]);export{_ as __pageData,g as default};
